import React from "react";
// import ChooseButton from "../Elements/Button/ChooseButton.js";

const WhoWeHelp = () => {

        return (
            <section className="t-help">
            <div className="container mb-50 ">
                <div className="whowehelp">

                <h1 className="c-heading c-heading--level1 e-alignCenter">Komu pomagamy</h1>
                <div className="c-icon-box__image"></div>


                    <div className='whowehelp-buttons'>
                        <div text={"Fundacjom"} />
                        <div text={"Organizacjom pozarządowym"} />
                        <div text={"Lokalnym zbiórkom"}  />
                    </div>
                    <div className="whowehelp-description">
                        <p>W naszej bazie znajdziesz listę zweryfikowanych Fundacji, z którymi współpracujemy. Możesz sprawdzić czym się zajmują, komu pomagają i czego potrzebują.</p>
                    </div>
                </div>
            </div>

            </section>
        )
    }

export default WhoWeHelp;
